import React, { useState } from "react";
import TodoInsert from "./Components/TodoInsert";

const App = () => {
  const [name, setName] = useState("");

  const onChange = e => {
    setName(e.target.value);
  };

  return (
    <div>
      <TodoInsert onChange={onChange}></TodoInsert>제 이름은 ${name} 입니다.
    </div>
  );
};

export default App;
